		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pProcess = new ProcessElements();
		this.pTry = new TryElements();
		this.pFinally = new FinallyElements();
		this.pCatch = new CatchElements();
